define('utils/LocalParams',[],function() {

    //UTILITY TO MANAGE LOCAL PARAMS (not synced, inherent to device)
    var LocalParams = {

        init: function() {
            var self = this;
            //Default parameters
            if (_.isNull(self.isFirstLaunch())) {
                self.setFirstLaunch("true");
            }
        },

        /* GLOBAL LOCALSTORAGE TOOLS */

        setParam: function(name, value) {
            if (localStorage) {
                localStorage.setItem(name, value);
            }
        },

        getParam: function(name) {
            var param = localStorage.getItem(name);
            //String to boolean
            if (param == "true") {
                param = true;
            }
            else if (param == "false") {
                param = false;
            }
            else if (param == "null") {
                param = null;
            }

            return param;
        },

        //NON SYNCED PARAMS

        /* LEARNING STACK OPTIONS */
        /* FIRST USE */
        setFirstLaunch: function(firstLaunch) {
            return this.setParam("PREGO.firstLaunch", firstLaunch);
        },

        isFirstLaunch: function() {
            return this.getParam("PREGO.firstLaunch");
        },

        /* TRANSLATION DISPLAY */
        setUserTranslationLang: function(lang) {
            this.setParam("PREGO.translation", lang);
        },

        getUserTranslationLang: function() {
            return this.getParam("PREGO.translation");
        },

        /* SET SUBSCRIPTION DONE */
        setBonusUnlocked: function() {
            this.setParam("PREGO.bonusUnlocked", "true");
        },

        getBonusUnlocked: function() {
            return this.getParam("PREGO.bonusUnlocked");
        }

        /* UNLOCKED */
        
    };

    return LocalParams;

});
define('utils/Localization',["underscore",
       "backbone",
       "utils/LocalParams"],
            function(
                _,
                Backbone,
                LocalParams) {

    var Localization = {

        init: function(lang) {
            var self = this;

            if(lang) {
                if(self.isLangInSupportedTranslation(lang)) {
                    self.loadTranslation(lang, true);
                    return;
                }
            }

            if(_.isNull(LocalParams.getUserTranslationLang())) {
                var navigatorLang = self.getNavigatorLang();
                //Try to set the translation on the navigator of the user
                if(self.isLangInSupportedTranslation(navigatorLang)) {
                    self.loadTranslation(navigatorLang, true);
                }
                //if not available
                else {
                    //Try to set English
                    if(self.isLangInSupportedTranslation("en")) {
                        self.loadTranslation("en", true);
                    }
                }
            }
            else {
                //Not the first use
                self.loadTranslation(LocalParams.getUserTranslationLang(), true);
            }
        },

        loadTranslation: function(translation, firstLoad) {
            var self = this;

            $.ajax({
              url: self.getPath(translation),
              async : true,
              // dataType: 'json',
              success: function(data) {
                self.STR = data;
                self.translationLoaded = translation;
                LocalParams.setUserTranslationLang(translation);
                if(firstLoad) {
                    self.trigger("STRSuccess STRLoaded");
                }
                else {
                    self.trigger("STRSuccess STRChanged");
                }
              },
              error: function(e) {
                console.log('Error while loading : ' + self.getPath(translation));
              }
            });
        },

        getPath:function(translation) {
            var self = this;

            var path = "data/content/string_"+translation+".json";

            return path;
        },

        getSupportedTranslation:function() {
            return ['en','fr','es'];
        },

        isLangInSupportedTranslation:function(lang) {
            return _.contains(this.getSupportedTranslation(),lang);
        },

        getNavigatorLang:function() {
            var language = window.navigator.language;
            var lang = "";
            if(language) {
                lang = language.substring(0,2);
            }
            return lang;
        }

    };

    //Give capability to use events
    _.extend(Localization, Backbone.Events);

    return Localization;

});
