define('models/Sound',['jquery',
        'underscore',
        'backbone',
        'utils/GeoUtils',
        'utils/Logger',
        'howl'
        ],
function($, _, Backbone, GeoUtils, LOGGER){

  var Sound = Backbone.Model.extend({

    position: undefined,
    vol: undefined,
    path: undefined,
    type: undefined,
    db: undefined,

    idAttribute: "path",

    initialize: function() {
        var self = this;

        self.path = self.get("path");
        self.position = self.get("position");
        self.db = self.get("db");
        self.type = self.get("type");

        self.sound = new Howl({
          urls: ['https://s3.amazonaws.com/pregonerosdemedellin/data/' + self.path + '.mp3'],
          loop:true,
          volume:0,
          onload: function() {
            self.trigger("soundLoaded");
          }
        });

        self.sound.play();
    },

    updateVolume: function(newUserPosition) {
            var self = this;

            // Calculate distance between user and sound
            var distance = GeoUtils.distance(self.position, newUserPosition);
            
            // Calculate new volume based on distance
            self.vol = self.calculateVolume(distance);

            // Set new volume
            self.sound.volume(self.vol);

            LOGGER.debug(self.path + "PLAYING WITH VOL: " + self.vol);
    },

    updatePan : function(newUserPosition){

        var self = this;

        var xDiff = self.position[0] - newUserPosition[0],
            yDiff = self.position[1] - newUserPosition[1],
            angle = Math.atan2(yDiff, xDiff) * (180/Math.PI);

        // Add POV heading offset ,  always the same because we go through a line
        angle -= GeoUtils.getBearing([
                6.258111140611143,
                -75.61215072870255
                ],
                [
                6.257839185538634,
                -75.61139702796936
                ]);

        LOGGER.debug("Bearing " + GeoUtils.getBearing(newUserPosition,self.position));

        // Convert angle to range between -180 and +180
        if (angle < -180)       angle += 360;
        else if (angle > 180)   angle -= 360;

        LOGGER.debug("ANGLE: " + angle);

        // Calculate panPosition, as a range between -1 and +1
        var panPosition = (angle/90);
        if (Math.abs(panPosition) > 1) {
            var x = Math.abs(panPosition) - 1;
            panPosition = (panPosition > 0) ? 1 - x : -1 + x;
        }

        LOGGER.debug("PANPOSITION " + panPosition);

        // Set the new pan poition
        self.sound.pos3d(panPosition, 1, 1);

        // Apply lowpass filter *if* the sound is behind us (11,000hz = filter fully open)
        // var freq = 11000;
        // if (Math.abs(angle) > 90) {
        //     // User's back is to the sound - progressively apply filter
        //     freq -= (Math.abs(angle) - 90) * 55;
        // }
        // self.sound.filter(freq);
    },

    updateSound: function(newUserPosition) {
        var self = this;
        // self.updatePan(newUserPosition);
        self.updateVolume(newUserPosition);
    },

    calculateVolume: function(distance){
        var self = this;

        var vol = 0;

        if(self.type == "ambient") {
            vol = 1 / (distance);
        }
        else if(self.type == "punctual") {
            vol = 1 / (distance * distance);
        }
        
        // Multiply distance volume by amplitude of sound (apply ceiling max of 1)
        vol = Math.min((vol * self.db), 1);
        return vol;
    },

    unload: function() {
        var self = this;
        self.sound.unload();
    }

  });

  return Sound;
  
});



define('models/Sounds',['jquery',
        'underscore',
        'backbone',
        'models/Sound',
        'utils/GeoUtils',
        'utils/Logger'
        ],
function($, _, Backbone,
                Sound,
                GeoUtils,
                LOGGER){

  var Sounds = Backbone.Collection.extend({

    model: Sound,

    playSoundHome: function() {
        var self = this;

        self.soundHome = new Howl({
          urls: ['content/music/intro.mp3'],
          loop:true,
          volume:1,
          onload: function() {
            self.soundHome.play();
          }
        });
    },

    fadeOutSoundHome: function() {
        var self = this;

        if(self.soundHome) {
            self.soundHome.fadeOut(0,3000);
        }
    },

    updateSoundsCollection:function(waySounds) {
        var self = this;
        if(_.isUndefined(self.waySounds)) {
            self.previousWaySounds = [];
        }
        else {
            self.previousWaySounds = self.waySounds;
        }
        
        self.waySounds = waySounds;

        self.waySoundsIds = _.pluck(self.waySounds,"path");
        self.previousWaySoundsIds = _.pluck(self.previousWaySounds,"path");

        //intersection
        self.soundsToKeepIds = _.intersection(self.previousWaySoundsIds,self.waySoundsIds);
        self.soundsToRemoveIds = _.difference(self.previousWaySoundsIds,self.soundsToKeepIds);
        self.soundsToAddIds = _.difference(self.waySoundsIds,self.soundsToKeepIds);

        self.soundsToAdd = [];

        _.each(self.soundsToAddIds,function(soundToAddId) {
            self.soundsToAdd.push(_.findWhere(self.waySounds, {path: soundToAddId}));
        });

    },

    updateSounds: function(newUserPosition) {
        var self = this;

        if(self.models.length === 0) {
            return;
        }

        var twoClosestNode = self.getTwoClosestNode(newUserPosition);

        //set other node to 0 vol
        _.each(self.models, function(sound) {
            if(sound.type == "punctual") {
                sound.updateSound(newUserPosition);
            }
            else if(sound.cid != twoClosestNode.closestNode.sound.cid && sound.cid != twoClosestNode.secondClosestNode.sound.cid) {
                sound.sound.volume(0);
                LOGGER.debug("SET VOLUME 0 TO " + sound.path);
            }
        });

        if(!_.isUndefined(twoClosestNode.closestNode.sound)) {
            twoClosestNode.closestNode.sound.updateSound(newUserPosition);
        }

        if(!_.isUndefined(twoClosestNode.secondClosestNode.sound)) {
            twoClosestNode.secondClosestNode.sound.updateSound(newUserPosition);
        }
    },

    getTwoClosestNode: function(position) {
        var self = this;

        var closestNode = {
            sound:undefined,
            distance:100000000000
        };

        var secondClosestNode = {
            sound:undefined,
            distance:100000000000
        };

        _.each(self.models,function(sound) {
            if(sound.type == "ambient") {
                var soundDistanceToPosition = GeoUtils.distance(sound.position,position);
                if(soundDistanceToPosition < closestNode.distance) {
                    //new closest node
                    secondClosestNode = closestNode;
                    closestNode = {
                        sound:sound,
                        distance:soundDistanceToPosition
                    };
                }
                else if(soundDistanceToPosition < secondClosestNode.distance) {
                    //new second closest node
                    secondClosestNode = {
                        sound:sound,
                        distance:soundDistanceToPosition
                    };
                }
            }
        });

        return {
            "closestNode":closestNode,
            "secondClosestNode":secondClosestNode
        };
    },

    fetch: function() {
            var self = this;

            if(_.isUndefined(self.soundsToAdd)) {
                self.trigger('noSounds');
                return;
            }

            //Remove old sounds
            _.each(self.soundsToRemoveIds, function(soundToRemove) {
                self.remove(soundToRemove).unload();
            });

            var nbSoundsToLoad = self.soundsToAdd.length;
            
            _.each(self.soundsToAdd, function(waySound) {

                var sound = new Sound({
                        position: waySound.position,
                        path: waySound.path,
                        db: waySound.db,
                        type: waySound.type
                        });

                self.add(sound);

                sound.on("soundLoaded",function() {
                    nbSoundsToLoad--;

                    if(nbSoundsToLoad === 0) {
                        self.trigger('soundsLoaded');
                        LOGGER.debug("ALL SOUNDS LOADED");
                    }
                });

            });
    },

    mute: function() {
        Howler.mute();
    },

    unmute: function() {
        Howler.unmute();
    },

    clear: function() {
        var self = this;
    }


  });

  return new Sounds();
  
});



